import React from "react";
import "./index.css";
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';

const SubCom = (props) =>{
    return(
        <>
        <div className="subcomp">
            
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button className="btn_style-1" onClick={()=>{
                props.onselect(props.id)
            }}>
            <DeleteOutlineIcon />
                
            </button>
            
        </div>

        </>
    )
}

export default SubCom;
